import React from 'react'
import './index.css'

function Card(props)
{
    return(
<div className='Cards'>
        <div className='Card'>
            <img className='Imgclass' src={props.imgsrc} alt='Lalettan.jpg'/>
            <div className='Cardinfo'>
            <span className='Fontclass'>{props.title}</span><br/>
            <a href='https://www.google.com/' className='Linkclass' > {props.title}</a>
            
            </div>
        </div>

    </div>
);
}

export default Card;
